import MlApi from '../apis/MlApi'
import tokenCookie from '../components/GetCookie'
import Axios from 'axios';

const IsAuthenitcated = async () => {
    if(tokenCookie.length > 1){
        return true;
    }
}
export default IsAuthenitcated
